import React from "react";
import './css/LoginSection.scss';

export default function LoginSection() {

    return (
        <>
            <section className="component-login-section">
                <div className='login-section'>
                    <h3 className='login-section-title'>Авторизация</h3>
                    <form className='login-form'>
                        <input className='login-form-input' type='text' placeholder='Логин'></input>
                        <input className='login-form-input' type='password' placeholder='Пароль'></input>
                        <button className='login-form-button'>Войти</button>
                    </form>
                </div>
            </section>

        </>
    )
}
